import { combineReducers } from "redux";
import { ActionsTypes } from "./actions and const/actions";
import { COUNT_YEAR } from "./actions and const/const";
// import { GamingDeviceType } from "./gamingDeviceType"

type InitialStateType = {
    countYear: number | null;
};

const initialState: InitialStateType = {
    countYear: null,
};

const stateReducer = (state = initialState, action: ActionsTypes) => {
    switch (action.type) {
        case COUNT_YEAR: {
            return { ...state, countYear:  action.year};
        }

        default:
            return state;
    }
};

export const rootReducer = combineReducers({
    stateGamingDevices: stateReducer,
});
